import React, { Component } from 'react';


class Document extends Component {
  componentDidMount() {
    const d = document;
    const w = window;

    d.addEventListener('DOMContentLoaded', (e) => {
      sticky('.header');
      // hamburguerMenu('.panel-btn', '.panel', '.panel__menu-a');
      // scrollTopButton('.scroll-top-btn');
      // darkMode('#switch');
    });
  }

  render() {}
}

export default Document;
